import React, { Component } from "react";
import "./login.css";
import logo1 from '../images/logo1.svg';
// import { Button, Form, Image } from "react-bootstrap";
import { Col, Button, Form, Image  } from "reactstrap";

class Login extends Component {
  render() {
    return (
      <div className="container">
        <div className="card shadow my-5 mx-5 p-3 mb-2 bg-transbox">
          <div className="card-body p-5">
          <Col md={2} className="col-4 mx-auto">
            <Image src={logo1}/>
          </Col>
            <form action="#">
              <Form.Group controlId="formGroupEmail">
                <Form.Label>ชื่อผู้ใช้งาน</Form.Label>
                <Form.Control type="text" placeholder="เลขบัตรประชาชน" />
              </Form.Group>
              <Form.Group controlId="formGroupPassword">
                <Form.Label>รหัสผ่าน</Form.Label>
                <Form.Control type="password" placeholder="Password" />
              </Form.Group>

              <Button className="mx-auto d-block" type="submit">ลงชื่อเข้าใช้</Button>
            </form>

            <div style={{ height: 100 }} />
            <p className="lead mb-0">footer</p>
          </div>
        </div>
      </div>
    );
  }
}
export default Login;
